FastClick.attach(document.body);

const YouTube = 'data:image/png;base64,';
const Tumblr = 'data:image/png;base64,';
const Twitter = 'data:image/png;base64,';
const Facebook = 'data:image/png;base64,';
const Vimeo = 'data:image/png;base64,';
const Vine = 'data:image/png;base64,';
const Aol = 'data:image/png;base64,';
const Dailymotion = 'data:image/png;base64,';

const base64Icons = {
    'youtube': YouTube,
    'tumblr': Tumblr,
    'twitter': Twitter,
    'facebook': Facebook,
    'vimeo': Vimeo,
    'vine': Vine,
    'aol': Aol,
    'dailymotion': Dailymotion,
};

let vm = null;

const classes = {
    'mp3': 'mp3',
    'mp4': 'mp4',
    'webm': 'webm',
    '3gp': 'v3gp',
};

function initCanvas () {
    let imgs = [];
    
    imgs.push(base64Icons[vm.platform]);
    delete base64Icons[vm.platform];

    for (let o in base64Icons) { imgs.push(base64Icons[o]); }

    let glpi = new GLParticleIcons('c', imgs, 50);

    window.addEventListener("touchstart", function (event) { glpi.change(); });
}

function initVideoEvents () {
    Vue.nextTick(function () {
        vm.$refs.v.addEventListener('play', () => vm.video.playing = true, false);
        vm.$refs.v.addEventListener('pause', () => vm.video.playing = false, false);
    });
}

window.onload = () => {
    const vw = window.innerWidth - 54;
    
    vm = new Vue({
        el: '#app',
        data: {
            link: '',
            platform: '',
            vw: vw,
            vh: Math.floor(vw * 9 / 16),
            classes: classes,
            video: null,
        },
        mounted: function() {
            this.$nextTick(function(){
                $notify('exec', { func: 'ready' });
            });
        },
        watch: {
            video (val) {
                if (val && val !== '') {
                    this.$set(vm.video, 'touch', false);
                    initVideoEvents();
                }
            },
            platform (val) {
                if (val !== '') initCanvas();
            }
        },
        methods: {
            download (v) {
                $notify('exec', {func: 'downloadVideo', params: v});
            },
            convertVideo (v) {
                $notify('exec', {func: 'convertYouTubeVideo', params: v});
            },
            fadeInVideo () {
                if (this.video.playing) return;
                this.$nextTick(() => {
                    vm.$refs.v.addEventListener('play', () => vm.video.playing = true, false);
                    vm.$refs.v.addEventListener('pause', () => vm.video.playing = false, false);
                });
            }
        }
    });
}
